import React, { useState } from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
// import { auth, db } from "../firebase/config";
import ReactMapGL, { Marker } from "react-map-gl";

export default function Map() {
    mapboxgl.accessToken = 'pk.eyJ1IjoicGFrYXdhdHRpcHNvIiwiYSI6ImNraTZ4aDI2ZzAyd3czMHA5a2JoNzZ3bjkifQ.RJr4KL_OPY4n8RL3wUc9tg'
  const [viewport, setViewport] = useState({
    width: "100vw",
    height: "50vh",
    latitude: 13.745627822680577,
    longitude: 100.53415690427192,
    zoom: 15,
  });

//   const marker = new mapboxgl.Marker()
//     .setLngLat([12.550343, 55.665957])
//     .addTo(map);

  return (
    <div>
      <Header />
      <div>
        <ReactMapGL
          {...viewport}
          mapboxApiAccessToken={process.env.REACT_APP_MAPBOX_TOKEN}
          mapStyle="mapbox://styles/mapbox/streets-v11"
          onViewportChange={(viewport) => {
            setViewport(viewport);
          }}
        >
          <Marker latitude={13.745627822680577} longitude={100.53415690427192}>
            <div></div>
          </Marker>
        </ReactMapGL>
      </div>
      <Footer />
    </div>
  );
}
